import "./index.css";

// Desestructuracion
// Asignacion desestructurante

const persona = {
  nombre: "Rimuru",
  apellido: "Tempest",
  edad: 2,
  clave: "Ciel",
};

const { nombre, apellido, edad, clave } = persona;

console.log(nombre, apellido, edad, clave);

const retornarPersona = ({ nombre, edad, apellido, clave }) => {
  return {
    nombreClave: clave,
    edad: edad,
  };
};

const rimuru = retornarPersona(persona);

console.log(rimuru);
